import React from 'react'
class Users extends React.Component {
  render() {
    return (
      <React.Fragment>
        <h1>Please Sign In</h1>
        <div>
          <label>Username</label>
          <input type="text"/>
        </div>
      </React.Fragment>
    )
  }
}
export default Users
